class Solution {
    /**
    You're given a list of deposit and withdrawal operations on a bank account that starts with
    zero balance. Your task is to detect if at any point the balance of account falls below zero, and
    at that point function should return True. Otherwise it should return False.
    >>> below_zero(Arrays.asList(1, 2, 3))
    false
    >>> below_zero(Arrays.asList(1, 2, -4, 5))
    true
     */
    public boolean below_zero(List<Integer> operations) {
        int balance = 0;
        for (int operation : operations) {
            balance += operation;
            if (balance < 0) {
                return true;
            }
        }
        return false;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test case 1: No withdrawals
        List<Integer> operations1 = Arrays.asList(1, 2, 3);
        System.out.println("Test case 1: " + solution.below_zero(operations1)); // Expected output: false

        // Test case 2: Withdrawal that brings balance below zero
        List<Integer> operations2 = Arrays.asList(1, 2, -4, 5);
        System.out.println("Test case 2: " + solution.below_zero(operations2)); // Expected output: true

        // Test case 3: Multiple withdrawals that bring balance below zero
        List<Integer> operations3 = Arrays.asList(1, -2, -3, 5);
        System.out.println("Test case 3: " + solution.below_zero(operations3)); // Expected output: true

        // Test case 4: No operations
        List<Integer> operations4 = new ArrayList<>();
        System.out.println("Test case 4: " + solution.below_zero(operations4)); // Expected output: false
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                !s.below_zero(new ArrayList<>(Arrays.asList())),
                !s.below_zero(new ArrayList<>(Arrays.asList(1, 2, -3, 1, 2, -3))),
                s.below_zero(new ArrayList<>(Arrays.asList(1, 2, -4, 5, 6))),
                !s.below_zero(new ArrayList<>(Arrays.asList(1, -1, 2, -2, 5, -5, 4, -4))),
                s.below_zero(new ArrayList<>(Arrays.asList(1, -1, 2, -2, 5, -5, 4, -5))),
                s.below_zero(new ArrayList<>(Arrays.asList(1, -2, 2, -2, 5, -5, 4, -4)))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

