class Solution {
    /**
    Input to this function is a string represented multiple groups for nested parentheses separated by spaces.
    For each of the group, output the deepest level of nesting of parentheses.
    E.g. (()()) has maximum two levels of nesting while ((())) has three.

    >>> parse_nested_parens("(()()) ((())) () ((())()())")
    [2, 3, 1, 3]
     */
    public List<Integer> parse_nested_parens(String paren_string) {
        String[] groups = paren_string.split(" ");
        List<Integer> result = new ArrayList<>();

        for (String group : groups) {
            int maxDepth = 0;
            int currentDepth = 0;

            for (char c : group.toCharArray()) {
                if (c == '(') {
                    currentDepth++;
                    maxDepth = Math.max(maxDepth, currentDepth);
                } else if (c == ')') {
                    currentDepth--;
                }
            }

            result.add(maxDepth);
        }

        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test case 1
        String input1 = "(()()) ((())) () ((())()())";
        List<Integer> expected1 = Arrays.asList(2, 3, 1, 3);
        System.out.println("Test case 1:");
        System.out.println("Input: " + input1);
        System.out.println("Expected output: " + expected1);
        System.out.println("Actual output: " + solution.parse_nested_parens(input1));
        System.out.println();

        // Test case 2
        String input2 = "(()) () ()";
        List<Integer> expected2 = Arrays.asList(2, 1, 1);
        System.out.println("Test case 2:");
        System.out.println("Input: " + input2);
        System.out.println("Expected output: " + expected2);
        System.out.println("Actual output: " + solution.parse_nested_parens(input2));
        System.out.println();

        // Test case 3
        String input3 = "((()))";
        List<Integer> expected3 = Arrays.asList(3);
        System.out.println("Test case 3:");
        System.out.println("Input: " + input3);
        System.out.println("Expected output: " + expected3);
        System.out.println("Actual output: " + solution.parse_nested_parens(input3));
        System.out.println();
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.parse_nested_parens("(()()) ((())) () ((())()())").equals(Arrays.asList(2, 3, 1, 3)),
                s.parse_nested_parens("() (()) ((())) (((())))").equals(Arrays.asList(1, 2, 3, 4)),
                s.parse_nested_parens("(()(())((())))").equals(Arrays.asList(4))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

