        System.out.println("Test Case 1:");
        System.out.println("Input: " + numbers1);
        System.out.println("Expected Output: []");
        System.out.println("Actual Output: " + solution.intersperse(numbers1, 4));
        System.out.println();

        System.out.println("Test Case 2:");
        System.out.println("Input: " + numbers2);
        System.out.println("Expected Output: [1, 4, 2, 4, 3]");
        System.out.println("Actual Output: " + solution.intersperse(numbers2, 4));
        System.out.println();

        System.out.println("Test Case 3:");
        System.out.println("Input: " + numbers3);
        System.out.println("Expected Output: [1, 4, 2, 4, 3, 4, 4, 4, 5]");
        System.out.println("Actual Output: " + solution.intersperse(numbers3, 4));
    }
}

