class Solution {
    /**
    Check if in given list of numbers, are any two numbers closer to each other than given threshold.
    >>> has_close_elements(Arrays.asList(1.0, 2.0, 3.0), 0.5)
    false
    >>> has_close_elements(Arrays.asList(1.0, 2.8, 3.0, 4.0, 5.0, 2.0), 0.3)
    true
     */
    public boolean has_close_elements(List<Double> numbers, double threshold) {
        Collections.sort(numbers);
        for (int i = 0; i < numbers.size() - 1; i++) {
            if (numbers.get(i + 1) - numbers.get(i) < threshold) {
                return true;
            }
        }
        return false;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test case 1:
        List<Double> numbers1 = Arrays.asList(1.0, 2.0, 3.0);
        double threshold1 = 0.5;
        System.out.println("Test case 1: " + solution.has_close_elements(numbers1, threshold1)); // Expected output: false

        // Test case 2:
        List<Double> numbers2 = Arrays.asList(1.0, 2.8, 3.0, 4.0, 5.0, 2.0);
        double threshold2 = 0.3;
        System.out.println("Test case 2: " + solution.has_close_elements(numbers2, threshold2)); // Expected output: true

        // Test case 3: empty list
        List<Double> numbers3 = new ArrayList<>();
        double threshold3 = 0.5;
        System.out.println("Test case 3: " + solution.has_close_elements(numbers3, threshold3)); // Expected output: false

        // Test case 4: list with single element
        List<Double> numbers4 = Arrays.asList(1.0);
        double threshold4 = 0.5;
        System.out.println("Test case 4: " + solution.has_close_elements(numbers4, threshold4)); // Expected output: false
    }
}

