class Solution {
    /**
     * For a given list of input numbers, calculate Mean Absolute Deviation
     * around the mean of this dataset.
     * Mean Absolute Deviation is the average absolute difference between each
     * element and a centerpoint (mean in this case):
     * MAD = average | x - x_mean |
     */
    public double mean_absolute_deviation(List<Double> numbers) {
        // Calculate the mean
        double sum = 0;
        for (double num : numbers) {
            sum += num;
        }
        double mean = sum / numbers.size();

        // Calculate the absolute deviations from the mean
        double sumAbsDev = 0;
        for (double num : numbers) {
            sumAbsDev += Math.abs(num - mean);
        }

        // Calculate the Mean Absolute Deviation
        return sumAbsDev / numbers.size();
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test case 1:
        List<Double> numbers1 = Arrays.asList(1.0, 2.0, 3.0, 4.0);
        System.out.println("Test case 1: " + solution.mean_absolute_deviation(numbers1)); // Expected output: 1.0

        // Test case 2:
        List<Double> numbers2 = Arrays.asList(10.0, 20.0, 30.0, 40.0);
        System.out.println("Test case 2: " + solution.mean_absolute_deviation(numbers2)); // Expected output: 10.0

        // Test case 3:
        List<Double> numbers3 = Arrays.asList(1.5, 2.5, 3.5, 4.5);
        System.out.println("Test case 3: " + solution.mean_absolute_deviation(numbers3)); // Expected output: 1.0

        // Test case 4: Empty list
        List<Double> numbers4 = new ArrayList<>();
        try {
            System.out.println("Test case 4: " + solution.mean_absolute_deviation(numbers4));
        } catch (ArithmeticException e) {
            System.out.println("Test case 4: " + e.getMessage()); // Expected output: / by zero
        }

        // Test case 5: Single element list
        List<Double> numbers5 = Arrays.asList(5.0);
        System.out.println("Test case 5: " + solution.mean_absolute_deviation(numbers5)); // Expected output: 0.0
    }
}

