class Solution {
    /**
    For a given list of integers, return a tuple consisting of a sum and a product of all the integers in a list.
    Empty sum should be equal to 0 and empty product should be equal to 1.
    >>> sum_product(List.of())
    [0, 1]
    >>> sum_product(Arrays.asList(1, 2, 3, 4))
    [10, 24]
     */
    public List<Integer> sum_product(List<Integer> numbers) {
        int sum = 0;
        int product = 1;
        for (int num : numbers) {
            sum += num;
            product *= num;
        }
        return Arrays.asList(sum, product);
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test case 1: Empty list
        List<Integer> result1 = solution.sum_product(List.of());
        System.out.println("Test case 1: " + result1);
        assert result1.equals(Arrays.asList(0, 1)) : "Test case 1 failed";

        // Test case 2: Non-empty list
        List<Integer> result2 = solution.sum_product(Arrays.asList(1, 2, 3, 4));
        System.out.println("Test case 2: " + result2);
        assert result2.equals(Arrays.asList(10, 24)) : "Test case 2 failed";

        // Test case 3: Single element list
        List<Integer> result3 = solution.sum_product(Arrays.asList(5));
        System.out.println("Test case 3: " + result3);
        assert result3.equals(Arrays.asList(5, 5)) : "Test case 3 failed";

        // Test case 4: List with negative numbers
        List<Integer> result4 = solution.sum_product(Arrays.asList(-1, -2, -3, -4));
        System.out.println("Test case 4: " + result4);
        assert result4.equals(Arrays.asList(-10, 24)) : "Test case 4 failed";

        System.out.println("All test cases passed");
    }
}

