class Solution {
    /**
     * Given a string, find out how many distinct characters (regardless of case) does it consist of
     * 
     * @param string the input string
     * @return the number of distinct characters in the string
     */
    public int count_distinct_characters(String string) {
        // Convert the string to lowercase to ignore case
        string = string.toLowerCase();

        // Use a HashSet to store unique characters
        Set<Character> uniqueChars = new HashSet<>();

        // Iterate over each character in the string
        for (char c : string.toCharArray()) {
            // Add the character to the set
            uniqueChars.add(c);
        }

        // Return the size of the set, which represents the number of distinct characters
        return uniqueChars.size();
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.count_distinct_characters("xyzXYZ"));  // Expected output: 3
