class Solution {
    /**
    Input is a space-delimited string of numberals from 'zero' to 'nine'.
    Valid choices are 'zero', 'one', 'two', 'three', 'four', 'five', 'six', 'seven', 'eight' and 'nine'.
    Return the string with numbers sorted from smallest to largest
    >>> sort_numbers("three one five")
    "one three five"
     */
    public String sort_numbers(String numbers) {
        String[] numArray = numbers.split(" ");
        String[] numOrder = {"zero", "one", "two", "three", "four", "five", "six", "seven", "eight", "nine"};
        Arrays.sort(numArray, (a, b) -> Arrays.asList(numOrder).indexOf(a) - Arrays.asList(numOrder).indexOf(b));
        return String.join(" ", numArray);
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.sort_numbers("three one five"));  // "one three five"
        System.out.println(solution.sort_numbers("nine eight seven six five four three two one zero"));  // "zero one two three four five six seven eight nine"
        System.out.println(solution.sort_numbers("five four three two one"));  // "one two three four five"
        System.out.println(solution.sort_numbers("zero zero one one two two three three"));  // "zero zero one one two two three three"
    }
}

