class Solution {
    /**
    Find how many times a given substring can be found in the original string. Count overlaping cases.
    >>> how_many_times("", "a")
    0
    >>> how_many_times("aaa", "a")
    3
    >>> how_many_times("aaaa", "aa")
    3
     */
    public int how_many_times(String string, String substring) {
        int count = 0;
        for (int i = 0; i <= string.length() - substring.length(); i++) {
            if (string.substring(i, i + substring.length()).equals(substring)) {
                count++;
            }
        }
        return count;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test case 1: Empty string
        System.out.println("Test case 1:");
        System.out.println("Expected output: 0");
        System.out.println("Actual output: " + solution.how_many_times("", "a"));
        System.out.println();

        // Test case 2: Single character substring
        System.out.println("Test case 2:");
        System.out.println("Expected output: 3");
        System.out.println("Actual output: " + solution.how_many_times("aaa", "a"));
        System.out.println();

        // Test case 3: Overlapping substrings
        System.out.println("Test case 3:");
        System.out.println("Expected output: 3");
        System.out.println("Actual output: " + solution.how_many_times("aaaa", "aa"));
        System.out.println();

        // Test case 4: No matches
        System.out.println("Test case 4:");
        System.out.println("Expected output: 0");
        System.out.println("Actual output: " + solution.how_many_times("hello", "world"));
        System.out.println();

        // Test case 5: Substring is longer than string
        System.out.println("Test case 5:");
        System.out.println("Expected output: 0");
        System.out.println("Actual output: " + solution.how_many_times("hello", "hello world"));
        System.out.println();
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.how_many_times("", "x") == 0,
                s.how_many_times("xyxyxyx", "x") == 4,
                s.how_many_times("cacacacac", "cac") == 4,
                s.how_many_times("john doe", "john") == 1
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

