class Solution {
    /**
    For a given string, flip lowercase characters to uppercase and uppercase to lowercase.
    >>> flip_case("Hello")
    "hELLO"
     */
    public String flip_case(String string) {
        StringBuilder result = new StringBuilder();
        for (char c : string.toCharArray()) {
            if (Character.isUpperCase(c)) {
                result.append(Character.toLowerCase(c));
            } else {
                result.append(Character.toUpperCase(c));
            }
        }
        return result.toString();
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.flip_case("Hello")); // "hELLO"
        System.out.println(solution.flip_case("WORLD")); // "world"
        System.out.println(solution.flip_case("Java")); // "jAVA"
        System.out.println(solution.flip_case("aBcDeF")); // "AbCdEf"
        System.out.println(solution.flip_case("")); // ""
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                Objects.equals(s.flip_case(""), ""),
                Objects.equals(s.flip_case("Hello!"), "hELLO!"),
                Objects.equals(s.flip_case("These violent delights have violent ends"), "tHESE VIOLENT DELIGHTS HAVE VIOLENT ENDS")
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

