class Solution {
    /**
    From a list of integers, remove all elements that occur more than once.
    Keep order of elements left the same as in the input.
    >>> remove_duplicates(Array.asList(1, 2, 3, 2, 4))
    [1, 3, 4]
     */
    public List<Integer> remove_duplicates(List<Integer> numbers) {
        Map<Integer, Long> countMap = numbers.stream()
                .collect(Collectors.groupingByConcurrent(i -> i, Collectors.counting()));
        return numbers.stream()
                .filter(i -> countMap.get(i) == 1)
                .collect(Collectors.toList());
    }
}

public class Main {
    public static void main(String[] args) {
        Solution solution = new Solution();
        List<Integer> numbers = Arrays.asList(1, 2, 3, 2, 4);
        List<Integer> result = solution.remove_duplicates(numbers);
        System.out.println(result); // [1, 3, 4]

        numbers = Arrays.asList(1, 1, 2, 2, 3, 3, 4, 5);
        result = solution.remove_duplicates(numbers);
        System.out.println(result); // [4, 5]

        numbers = Arrays.asList(1, 2, 3, 4, 5);
        result = solution.remove_duplicates(numbers);
        System.out.println(result); // [1, 2, 3, 4, 5]

        numbers = Arrays.asList(1, 1, 1, 1, 1);
        result = solution.remove_duplicates(numbers);
        System.out.println(result); // []
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.remove_duplicates(new ArrayList<>(List.of())).equals(List.of()),
                s.remove_duplicates(new ArrayList<>(Arrays.asList(1, 2, 3, 4))).equals(Arrays.asList(1, 2, 3, 4)),
                s.remove_duplicates(new ArrayList<>(Arrays.asList(1, 2, 3, 2, 4, 3, 5))).equals(Arrays.asList(1, 4, 5))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

