class Solution {
    /**
    Return list of prime factors of given integer in the order from smallest to largest.
    Each of the factors should be listed number of times corresponding to how many times it appeares in factorization.
    Input number should be equal to the product of all factors
    >>> factorize(8)
    [2, 2, 2]
    >>> factorize(25)
    [5, 5]
    >>> factorize(70)
    [2, 5, 7]
     */
    public List<Integer> factorize(int n) {
        List<Integer> factors = new ArrayList<>();
        for (int i = 2; i * i <= n; i++) {
            while (n % i == 0) {
                factors.add(i);
                n /= i;
            }
        }
        if (n > 1) {
            factors.add(n);
        }
        return factors;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println("Test case 1:");
        System.out.println("Input: 8");
        System.out.println("Expected output: [2, 2, 2]");
        System.out.println("Actual output: " + solution.factorize(8));
        System.out.println();

        System.out.println("Test case 2:");
        System.out.println("Input: 25");
        System.out.println("Expected output: [5, 5]");
        System.out.println("Actual output: " + solution.factorize(25));
        System.out.println();

        System.out.println("Test case 3:");
        System.out.println("Input: 70");
        System.out.println("Expected output: [2, 5, 7]");
        System.out.println("Actual output: " + solution.factorize(70));
        System.out.println();

        System.out.println("Test case 4:");
        System.out.println("Input: 1");
        System.out.println("Expected output: []");
        System.out.println("Actual output: " + solution.factorize(1));
        System.out.println();

        System.out.println("Test case 5:");
        System.out.println("Input: 2");
        System.out.println("Expected output: [2]");
        System.out.println("Actual output: " + solution.factorize(2));
        System.out.println();
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.factorize(2).equals(List.of(2)),
                s.factorize(4).equals(Arrays.asList(2, 2)),
                s.factorize(8).equals(Arrays.asList(2, 2, 2)),
                s.factorize(3 * 19).equals(Arrays.asList(3, 19)),
                s.factorize(3 * 19 * 3 * 19).equals(Arrays.asList(3, 3, 19, 19)),
                s.factorize(3 * 19 * 3 * 19 * 3 * 19).equals(Arrays.asList(3, 3, 3, 19, 19, 19)),
                s.factorize(3 * 19 * 19 * 19).equals(Arrays.asList(3, 19, 19, 19)),
                s.factorize(3 * 2 * 3).equals(Arrays.asList(2, 3, 3))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

