    /**
    Evaluates polynomial with coefficients xs at point x.
    return xs[0] + xs[1] * x + xs[1] * x^2 + .... xs[n] * x^n
     */
    public double poly(List<Double> xs, double x) {
        double result = 0;
        for (int i = 0; i < xs.size(); i++) {
            result += xs.get(i) * Math.pow(x, i);
        }
        return result;
    }

    /**
    xs are coefficients of a polynomial.
    find_zero find x such that poly(x) = 0.
    find_zero returns only one zero point, even if there are many.
    Moreover, find_zero only takes list xs having even number of coefficients
    and largest non zero coefficient as it guarantees
    a solution.
    >>> find_zero(Arrays.asList(1, 2)) // f(x) = 1 + 2x
    -0.5
    >>> find_zero(Arrays.asList(-6, 11, -6, 1)) // (x - 1) * (x - 2) * (x - 3) = -6 + 11x - 6x^2 + x^3
    1.0
     */
    public double find_zero(List<Double> xs) {
        // Simple implementation using binary search
        double low = -1000;
        double high = 1000;
        double epsilon = 0.00001;

        while (high - low > epsilon) {
            double mid = (low + high) / 2;
            double value = poly(xs, mid);
            if (value < 0) {
                low = mid;
            } else {
                high = mid;
            }
        }

        return (low + high) / 2;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test case 1
        List<Double> xs1 = Arrays.asList(1.0, 2.0);
        double result1 = solution.find_zero(xs1);
        System.out.println("Test case 1: " + result1);
        assert Math.abs(result1 + 0.5) < 0.00001 : "Test case 1 failed";

        // Test case 2
        List<Double> xs2 = Arrays.asList(-6.0, 11.0, -6.0, 1.0);
        double result2 = solution.find_zero(xs2);
        System.out.println("Test case 2: " + result2);
        assert Math.abs(result2 - 1.0) < 0.00001 : "Test case 2 failed";

        // Test case 3
        List<Double> xs3 = Arrays.asList(1.0, -3.0, 2.0);
        double result3 = solution.find_zero(xs3);
        System.out.println("Test case 3: " + result3);
        assert Math.abs(result3 - 1.0) < 0.00001 || Math.abs(result3 - 2.0) < 0.00001 : "Test case 3 failed";

        System.out.println("All test cases passed");
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        Random rand = new Random(42);
        for (int i = 0; i < 100; i++) {
            int ncoeff = 2 * (rand.nextInt(3) + 1);
            List<Double> coeffs = new ArrayList<>();
            for (int j = 0; j < ncoeff; j++) {
                int coeff = rand.nextInt(20) - 10;
                if (coeff == 0) {
                    coeff = 1;
                }
                coeffs.add((double) coeff);
            }
            double solution = s.find_zero(coeffs);
            if (Math.abs(s.poly(coeffs, solution)) > 1e-4) {
                throw new AssertionError();
            }
        }
    }
}

