class Solution {
    /**
    This function takes a list l and returns a list l' such that
    l' is identical to l in the indicies that are not divisible by three, while its values at the indicies that are divisible by three are equal
    to the values of the corresponding indicies of l, but sorted in ascending order.
    >>> sort_third(Arrays.asList(1, 2, 3))
    [1, 2, 3]
    >>> sort_third(Arrays.asList(5, 6, 3, 4, 8, 9, 2))
    [2, 6, 3, 4, 8, 9, 5]
     */
    public List<Integer> sort_third(List<Integer> l) {
        List<Integer> thirdIndices = new ArrayList<>();
        for (int i = 0; i < l.size(); i++) {
            if (i % 3 == 0) {
                thirdIndices.add(l.get(i));
            }
        }
        Collections.sort(thirdIndices);
        int j = 0;
        for (int i = 0; i < l.size(); i++) {
            if (i % 3 == 0) {
                l.set(i, thirdIndices.get(j));
                j++;
            }
        }
        return l;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        List<Integer> list1 = Arrays.asList(1, 2, 3);
        List<Integer> result1 = solution.sort_third(list1);
        System.out.println(result1); // [1, 2, 3]

        List<Integer> list2 = Arrays.asList(5, 6, 3, 4, 8, 9, 2);
        List<Integer> result2 = solution.sort_third(list2);
        System.out.println(result2); // [2, 6, 3, 4, 8, 9, 5]

        List<Integer> list3 = Arrays.asList(10, 20, 30, 40, 50, 60);
        List<Integer> result3 = solution.sort_third(list3);
        System.out.println(result3); // [10, 20, 30, 40, 50, 60]

        List<Integer> list4 = Arrays.asList(1);
        List<Integer> result4 = solution.sort_third(list4);
        System.out.println(result4); // [1]

        List<Integer> list5 = Arrays.asList();
        List<Integer> result5 = solution.sort_third(list5);
        System.out.println(result5); // []
    }
}

