class Solution {
    /**
    returns encoded string by cycling groups of three characters.
     */
    public String encodeCyclic(String s) {
        // split string to groups. Each of length 3.
        List<String> groups = new ArrayList<>();
        for (int i = 0; i < s.length(); i += 3) {
            groups.add(s.substring(i, Math.min(i + 3, s.length())));
        }
        // cycle elements in each group. Unless group has fewer elements than 3.
        for (int i = 0; i < groups.size(); i++) {
            if (groups.get(i).length() == 3) {
                groups.set(i, groups.get(i).substring(1) + groups.get(i).charAt(0));
            }
        }
        return String.join("", groups);
    }

    /**
    takes as input string encoded with encodeCyclic function. Returns decoded string.
     */
    public String decodeCyclic(String s) {
        // split string to groups. Each of length 3.
        List<String> groups = new ArrayList<>();
        for (int i = 0; i < s.length(); i += 3) {
            groups.add(s.substring(i, Math.min(i + 3, s.length())));
        }
        // cycle elements in each group. Unless group has fewer elements than 3.
        for (int i = 0; i < groups.size(); i++) {
            if (groups.get(i).length() == 3) {
                groups.set(i, groups.get(i).charAt(2) + groups.get(i).substring(0, 2));
            }
        }
        return String.join("", groups);
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test encodeCyclic
        String originalString = "abcdefghi";
        String encodedString = solution.encodeCyclic(originalString);
        System.out.println("Original String: " + originalString);
        System.out.println("Encoded String: " + encodedString);

        // Test decodeCyclic
        String decodedString = solution.decodeCyclic(encodedString);
        System.out.println("Decoded String: " + decodedString);

        // Test edge cases
        System.out.println("Edge case: empty string");
        System.out.println("Encoded String: " + solution.encodeCyclic(""));
        System.out.println("Decoded String: " + solution.decodeCyclic(""));

        System.out.println("Edge case: single character");
        System.out.println("Encoded String: " + solution.encodeCyclic("a"));
        System.out.println("Decoded String: " + solution.decodeCyclic("a"));

        System.out.println("Edge case: two characters");
        System.out.println("Encoded String: " + solution.encodeCyclic("ab"));
        System.out.println("Decoded String: " + solution.decodeCyclic("ab"));
    }
}

