class Solution {
    /**
    pairs_sum_to_zero takes a list of integers as an input.
    it returns True if there are two distinct elements in the list that
    sum to zero, and False otherwise.
    >>> pairs_sum_to_zero(Arrays.asList(1, 3, 5, 0))
    false
    >>> pairs_sum_to_zero(Arrays.asList(1, 3, -2, 1))
    false
    >>> pairs_sum_to_zero(Arrays.asList(1, 2, 3, 7))
    false
    >>> pairs_sum_to_zero(Arrays.asList(2, 4, -5, 3, 5, 7))
    true
    >>> pairs_sum_to_zero(Arrays.asList(1))
    false
     */
    public boolean pairs_sum_to_zero(List<Integer> l) {
        Set<Integer> set = new HashSet<>();
        for (Integer num : l) {
            if (set.contains(-num)) {
                return true;
            }
            set.add(num);
        }
        return false;
    }

