class Solution {
    /**
    triples_sum_to_zero takes a list of integers as an input.
    it returns True if there are three distinct elements in the list that
    sum to zero, and False otherwise.

    >>> triples_sum_to_zero(Arrays.asList(1, 3, 5, 0))
    false
    >>> triples_sum_to_zero(Arrays.asList(1, 3, -2, 1))
    true
    >>> triples_sum_to_zero(Arrays.asList(1, 2, 3, 7))
    false
    >>> triples_sum_to_zero(Arrays.asList(2, 4, -5, 3, 9, 7))
    true
    >>> triples_sum_to_zero(Arrays.asList(1))
    false
     */
    public boolean triples_sum_to_zero(List<Integer> l) {
        if (l.size() < 3) {
            return false;
        }

        Collections.sort(l);

        for (int i = 0; i < l.size() - 2; i++) {
            int left = i + 1;
            int right = l.size() - 1;

            while (left < right) {
                int sum = l.get(i) + l.get(left) + l.get(right);

                if (sum == 0) {
                    return true;
                } else if (sum < 0) {
                    left++;
                } else {
                    right--;
                }
            }
        }

        return false;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        System.out.println(solution.triples_sum_to_zero(Arrays.asList(1, 3, 5, 0))); // false
        System.out.println(solution.triples_sum_to_zero(Arrays.asList(1, 3, -2, 1))); // true
        System.out.println(solution.triples_sum_to_zero(Arrays.asList(1, 2, 3, 7))); // false
        System.out.println(solution.triples_sum_to_zero(Arrays.asList(2, 4, -5, 3, 9, 7))); // true
        System.out.println(solution.triples_sum_to_zero(Arrays.asList(1))); // false
    }
}

