class Solution {
    /**
    The Fib4 number sequence is a sequence similar to the Fibbonacci sequnece that's defined as follows:
    fib4(0) -> 0
    fib4(1) -> 0
    fib4(2) -> 2
    fib4(3) -> 0
    fib4(n) -> fib4(n-1) + fib4(n-2) + fib4(n-3) + fib4(n-4).
    Please write a function to efficiently compute the n-th element of the fib4 number sequence.  Do not use recursion.
    >>> fib4(5)
    4
    >>> fib4(6)
    8
    >>> fib4(7)
    14
     */
    public int fib4(int n) {
        if (n < 0) {
            throw new IllegalArgumentException("n must be a non-negative integer");
        }

        if (n <= 1) {
            return 0;
        }

        if (n == 2) {
            return 2;
        }

        if (n == 3) {
            return 0;
        }

        int[] fib4 = new int[n + 1];
        fib4[0] = 0;
        fib4[1] = 0;
        fib4[2] = 2;
        fib4[3] = 0;

        for (int i = 4; i <= n; i++) {
            fib4[i] = fib4[i - 1] + fib4[i - 2] + fib4[i - 3] + fib4[i - 4];
        }

        return fib4[n];
    }
}

public class Main {
    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.fib4(5));  // Output: 4
        System.out.println(solution.fib4(6));  // Output: 8
        System.out.println(solution.fib4(7));  // Output: 14
        System.out.println(solution.fib4(0));  // Output: 0
        System.out.println(solution.fib4(1));  // Output: 0
        System.out.println(solution.fib4(2));  // Output: 2
        System.out.println(solution.fib4(3));  // Output: 0
    }
}

