class Solution {
    /**
    returns encoded string by shifting every character by 5 in the alphabet.
     */
    public String encodeShift(String s) {
        StringBuilder sb = new StringBuilder();
        for (char ch : s.toCharArray()) {
            sb.append((char) ('a' + ((ch + 5 - 'a') % 26)));
        }
        return sb.toString();
    }

    /**
    takes as input string encoded with encodeShift function. Returns decoded string.
     */
    public String decode_shift(String s) {
        StringBuilder sb = new StringBuilder();
        for (char ch : s.toCharArray()) {
            sb.append((char) ('a' + ((ch - 5 - 'a') % 26)));
        }
        return sb.toString();
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test case 1: encode and decode a simple string
        String originalString = "hello";
        String encodedString = solution.encodeShift(originalString);
        String decodedString = solution.decode_shift(encodedString);
        System.out.println("Original: " + originalString);
        System.out.println("Encoded: " + encodedString);
        System.out.println("Decoded: " + decodedString);

        // Test case 2: encode and decode a string with uppercase letters
        originalString = "HelloWorld";
        encodedString = solution.encodeShift(originalString.toLowerCase());
        decodedString = solution.decode_shift(encodedString);
        System.out.println("Original: " + originalString);
        System.out.println("Encoded: " + encodedString);
        System.out.println("Decoded: " + decodedString);

        // Test case 3: encode and decode a string with non-alphabet characters
        originalString = "hello123!@#";
        encodedString = solution.encodeShift(originalString.replaceAll("[^a-zA-Z]", "").toLowerCase());
        decodedString = solution.decode_shift(encodedString);
        System.out.println("Original: " + originalString);
        System.out.println("Encoded: " + encodedString);
        System.out.println("Decoded: " + decodedString);
    }
}

public class Main {
    static char[] letters = "abcdefghijklmnopqrstuvwxyz".toCharArray();
    static Random rand = new Random(42);

    public static String random_string(int length) {
        StringBuilder sb = new StringBuilder();
        for (int i = 0; i < length; i++) {
            sb.append(letters[rand.nextInt(26)]);
        }
        return sb.toString();
    }

    public static void main(String[] args) {
        Solution s = new Solution();
        for (int i = 0; i < 100; i++) {
            String str = random_string(rand.nextInt(10) + 10);
            String encode_str = s.encodeShift(str);
