class Solution {
    /**
    Return 2^n modulo p (be aware of numerics).
    >>> modp(3, 5)
    3
    >>> modp(1101, 101)
    2
    >>> modp(0, 101)
    1
    >>> modp(3, 11)
    8
    >>> modp(100, 101)
    1
     */
    public int modp(int n, int p) {
        return power(2, n, p);
    }

    private int power(int base, int exponent, int mod) {
        int result = 1;
        base = base % mod;
        while (exponent > 0) {
            if (exponent % 2 == 1) {
                result = (result * base) % mod;
            }
            exponent = exponent >> 1;
            base = (base * base) % mod;
        }
        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println("Test case 1: modp(3, 5) = " + solution.modp(3, 5)); // Expected output: 3
        System.out.println("Test case 2: modp(1101, 101) = " + solution.modp(1101, 101)); // Expected output: 2
        System.out.println("Test case 3: modp(0, 101) = " + solution.modp(0, 101)); // Expected output: 1
        System.out.println("Test case 4: modp(3, 11) = " + solution.modp(3, 11)); // Expected output: 8
        System.out.println("Test case 5: modp(100, 101) = " + solution.modp(100, 101)); // Expected output: 1
    }
}

