class Solution {
    /**
    brackets is a string of "<" and ">".
    return True if every opening bracket has a corresponding closing bracket.

    >>> correct_bracketing("<")
    false
    >>> correct_bracketing("<>")
    true
    >>> correct_bracketing("<<><>>")
    true
    >>> correct_bracketing("><<>")
    false
     */
    public boolean correct_bracketing(String brackets) {
        int balance = 0;
        for (char c : brackets.toCharArray()) {
            if (c == '<') {
                balance++;
            } else if (c == '>') {
                balance--;
                if (balance < 0) {
                    return false;
                }
            }
        }
        return balance == 0;
    }

