        System.out.println(solution.monotonic(Arrays.asList(5, 4, 3, 2, 1)));  // true
        System.out.println(solution.monotonic(Arrays.asList(1)));  // true
        System.out.println(solution.monotonic(Arrays.asList(1, 1)));  // true
    }
}

