class Solution {
    /**
     * Circular shift the digits of the integer x, shift the digits right by shift
     * and return the result as a string.
     * If shift > number of digits, return digits reversed.
     * >>> circular_shift(12, 1)
     * "21"
     * >>> circular_shift(12, 2)
     * "12"
     */
    public String circular_shift(int x, int shift) {
        String str = String.valueOf(x);
        int n = str.length();
        shift = shift % n; // handle cases where shift > number of digits
        if (shift == 0) return str;
        return str.substring(n - shift) + str.substring(0, n - shift);
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.circular_shift(12, 1)); // "21"
        System.out.println(solution.circular_shift(12, 2)); // "12"
