        System.out.println("Test case 2:");
        System.out.println("Expected output: 4");
        System.out.println("Actual output: " + solution.fibfib(5));
        System.out.println();

        System.out.println("Test case 3:");
        System.out.println("Expected output: 24");
        System.out.println("Actual output: " + solution.fibfib(8));
        System.out.println();
    }
}

