class Solution {
    /**
     * Returns True if the object q will fly, and False otherwise.
     * The object q will fly if it's balanced (it is a palindromic list) and the sum of its elements is less than or equal the maximum possible weight w.
     */
    public boolean will_it_fly(List<Integer> q, int w) {
        // Check if the list is palindromic
        boolean isPalindromic = isPalindrome(q);

        // Calculate the sum of the list elements
        int sum = sumOfElements(q);

        // Return true if the list is palindromic and the sum is less than or equal to the maximum weight
        return isPalindromic && sum <= w;
    }

    // Helper method to check if a list is palindromic
    private boolean isPalindrome(List<Integer> list) {
        int left = 0;
        int right = list.size() - 1;
        while (left < right) {
            if (!list.get(left).equals(list.get(right))) {
                return false;
            }
            left++;
            right--;
        }
        return true;
    }

    // Helper method to calculate the sum of list elements
    private int sumOfElements(List<Integer> list) {
        int sum = 0;
        for (Integer element : list) {
            sum += element;
        }
        return sum;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test case 1: Unbalanced and sum is less than the maximum weight
        List<Integer> q1 = Arrays.asList(1, 2);
        int w1 = 5;
        System.out.println("Test case 1: " + solution.will_it_fly(q1, w1)); // Expected output: false

        // Test case 2: Balanced but sum is more than the maximum weight
        List<Integer> q2 = Arrays.asList(3, 2, 3);
        int w2 = 1;
        System.out.println("Test case 2: " + solution.will_it_fly(q2, w2)); // Expected output: false

        // Test case 3: Balanced and sum is less than the maximum weight
        List<Integer> q3 = Arrays.asList(3, 2, 3);
        int w3 = 9;
        System.out.println("Test case 3: " + solution.will_it_fly(q3, w3)); // Expected output: true

        // Test case 4: Single element (balanced) and sum is less than the maximum weight
        List<Integer> q4 = Arrays.asList(3);
        int w4 = 5;
        System.out.println("Test case 4: " + solution.will_it_fly(q4, w4)); // Expected output: true
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.will_it_fly(new ArrayList<>(Arrays.asList(3, 2, 3)), 9),
                !s.will_it_fly(new ArrayList<>(Arrays.asList(1, 2)), 5),
                s.will_it_fly(new ArrayList<>(List.of(3)), 5),
