class Solution {
    /**
    Given list of integers, return list in strange order.
    Strange sorting, is when you start with the minimum value,
    then maximum of the remaining integers, then minimum and so on.

    Examples:
    strange_sort_list(Arrays.asList(1, 2, 3, 4)) == Arrays.asList(1, 4, 2, 3)
    strange_sort_list(Arrays.asList(5, 5, 5, 5)) == Arrays.asList(5, 5, 5, 5)
    strange_sort_list(Arrays.asList()) == Arrays.asList()
     */
    public List<Integer> strange_sort_list(List<Integer> lst) {
        List<Integer> result = new ArrayList<>();
        List<Integer> temp = new ArrayList<>(lst);

        while (!temp.isEmpty()) {
            int min = Collections.min(temp);
            result.add(min);
            temp.remove((Integer) min);

            if (!temp.isEmpty()) {
                int max = Collections.max(temp);
                result.add(max);
                temp.remove((Integer) max);
            }
        }

        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test case 1
        List<Integer> input1 = Arrays.asList(1, 2, 3, 4);
        List<Integer> expected1 = Arrays.asList(1, 4, 2, 3);
        System.out.println("Test case 1: " + (solution.strange_sort_list(input1).equals(expected1) ? "Pass" : "Fail"));

        // Test case 2
        List<Integer> input2 = Arrays.asList(5, 5, 5, 5);
        List<Integer> expected2 = Arrays.asList(5, 5, 5, 5);
        System.out.println("Test case 2: " + (solution.strange_sort_list(input2).equals(expected2) ? "Pass" : "Fail"));

        // Test case 3
        List<Integer> input3 = Arrays.asList();
        List<Integer> expected3 = Arrays.asList();
