        List<Integer> input4 = Arrays.asList(10, 20, 30, 40, 50);
        List<Integer> expected4 = Arrays.asList(10, 50, 20, 40, 30);
        System.out.println("Test case 4: " + (solution.strange_sort_list(input4).equals(expected4) ? "Pass" : "Fail"));
    }
}

