class Solution {
    /**
     * Returns true if the given number is the multiplication of 3 prime numbers
     * and false otherwise.
     * Knowing that the prime number is less then 100.
     * Example:
     * is_multiply_prime(30) == true
     * 30 = 2 * 3 * 5
     */
    public boolean is_multiply_prime(int a) {
        // Precompute all prime numbers less than 100
        boolean[] primes = new boolean[100];
        Arrays.fill(primes, true);
        primes[0] = primes[1] = false;
        for (int i = 2; i * i < 100; i++) {
            if (primes[i]) {
                for (int j = i * i; j < 100; j += i) {
                    primes[j] = false;
                }
            }
        }

        // Check all combinations of three prime numbers
        for (int i = 2; i < 100; i++) {
            if (primes[i]) {
                for (int j = i; j < 100; j++) {
                    if (primes[j]) {
                        for (int k = j; k < 100; k++) {
                            if (primes[k] && i * j * k == a) {
                                return true;
                            }
                        }
                    }
                }
            }
        }
        return false;
    }

    public static void main(String[] args) {
