    prime_length("Hello") == true
    prime_length("abcdcba") == true
    prime_length("kittens") == true
    prime_length("orange") == false
     */
    public boolean prime_length(String string) {
        int length = string.length();
        if (length <= 1) {
            return false;
        }
        for (int i = 2; i <= Math.sqrt(length); i++) {
            if (length % i == 0) {
                return false;
            }
        }
        return true;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.prime_length("Hello")); // true
        System.out.println(solution.prime_length("abcdcba")); // true
        System.out.println(solution.prime_length("kittens")); // true
        System.out.println(solution.prime_length("orange")); // false
        System.out.println(solution.prime_length("a")); // false
        System.out.println(solution.prime_length("")); // false
        System.out.println(solution.prime_length("ab")); // false
    }
}

