class Solution {
    /**
    Given a positive integer n, return the count of the numbers of n-digit
    positive integers that start or end with 1.
     */
    public int starts_one_ends(int n) {
        // Calculate the total number of n-digit numbers
        int total = (int) Math.pow(10, n);

        // Calculate the number of n-digit numbers that do not start with 1
        int notStartWithOne = (int) Math.pow(9, n);

        // Calculate the number of n-digit numbers that do not end with 1
        int notEndWithOne = (int) Math.pow(9, n);

        // Calculate the number of n-digit numbers that do not start and end with 1
        int notStartAndEndWithOne = (int) Math.pow(8, n);

        // Calculate the number of n-digit numbers that start or end with 1
        int result = total - notStartWithOne - notEndWithOne + notStartAndEndWithOne;

        return result;
    }
}

