        System.out.println(solution.anti_shuffle("a b c")); // "a b c"
        System.out.println(solution.anti_shuffle("abc def ghi")); // "abc def ghi"
        System.out.println(solution.anti_shuffle("")); // ""
        System.out.println(solution.anti_shuffle("   ")); // "   "
    }
}

