class Solution {
    /**
    You are given a 2 dimensional data, as a nested lists,
    which is similar to matrix, however, unlike matrices,
    each row may contain a different number of columns.
    Given lst, and integer x, find integers x in the list,
    and return list of lists, [[x1, y1], [x2, y2] ...] such that
    each list is a coordinate - (row, columns), starting with 0.
    Sort coordinates initially by rows in ascending order.
    Also, sort coordinates of the row by columns in descending order.

    Examples:
    get_row([
      [1,2,3,4,5,6],
      [1,2,3,4,1,6],
      [1,2,3,4,5,1]
    ], 1) == [[0, 0], [1, 4], [1, 0], [2, 5], [2, 0]]
    get_row([], 1) == []
    get_row([[], [1], [1, 2, 3]], 3) == [[2, 2]]
     */
    public List<List<Integer>> get_row(List<List<Integer>> lst, int x) {
        List<List<Integer>> result = new ArrayList<>();
        for (int i = 0; i < lst.size(); i++) {
            for (int j = 0; j < lst.get(i).size(); j++) {
                if (lst.get(i).get(j) == x) {
                    List<Integer> coord = new ArrayList<>();
                    coord.add(i);
                    coord.add(j);
                    result.add(coord);
                }
            }
        }
        Collections.sort(result, (a, b) -> {
            if (a.get(0).equals(b.get(0))) {
                return b.get(1).compareTo(a.get(1));
            } else {
                return a.get(0).compareTo(b.get(0));
            }
        });
        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        List<List<Integer>> lst1 = Arrays.asList(
            Arrays.asList(1, 2, 3, 4, 5, 6),
            Arrays.asList(1, 2, 3, 4, 1, 6),
            Arrays.asList(1, 2, 3, 4, 5, 1)
        );
        System.out.println(solution.get_row(lst1, 1)); // [[0, 0], [1, 4], [1, 0], [2, 5], [2, 0]]

        List<List<Integer>> lst2 = new ArrayList<>();
        System.out.println(solution.get_row(lst2, 1)); // []

        List<List<Integer>> lst3 = Arrays.asList(
            new ArrayList<>(),
            Arrays.asList(1),
            Arrays.asList(1, 2, 3)
        );
        System.out.println(solution.get_row(lst3, 3)); // [[2, 2]]
    }
}

