class Solution {
    /**
    Given an array of non-negative integers, return a copy of the given array after sorting,
    you will sort the given array in ascending order if the sum( first index value, last index value) is odd,
    or sort it in descending order if the sum( first index value, last index value) is even.

    Note:
    * don't change the given array.

    Examples:
    * sort_array(Arrays.asList()) => []
    * sort_array(Arrays.asList(5)) => [5]
    * sort_array(Arrays.asList(2, 4, 3, 0, 1, 5)) => [0, 1, 2, 3, 4, 5]
    * sort_array(Arrays.asList(2, 4, 3, 0, 1, 5, 6)) => [6, 5, 4, 3, 2, 1, 0]
     */
    public List<Integer> sort_array(List<Integer> array) {
        List<Integer> sortedArray = new ArrayList<>(array);
        if (!sortedArray.isEmpty()) {
            int sum = sortedArray.get(0) + sortedArray.get(sortedArray.size() - 1);
            if (sum % 2 == 0) {
                Collections.sort(sortedArray, Collections.reverseOrder());
            } else {
                Collections.sort(sortedArray);
            }
        }
        return sortedArray;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        List<Integer> testCases = Arrays.asList(
                Arrays.asList(),
                Arrays.asList(5),
                Arrays.asList(2, 4, 3, 0, 1, 5),
                Arrays.asList(2, 4, 3, 0, 1, 5, 6)
        );
        List<List<Integer>> expectedResults = Arrays.asList(
                Arrays.asList(),
                Arrays.asList(5),
                Arrays.asList(0, 1, 2, 3, 4, 5),
                Arrays.asList(6, 5, 4, 3, 2, 1, 0)
        );

        for (int i = 0; i < testCases.size(); i++) {
            List<Integer> result = solution.sort_array(testCases.get(i));
            System.out.println("Test Case " + (i + 1) + ": " + testCases.get(i));
            System.out.println("Expected Result: " + expectedResults.get(i));
            System.out.println("Actual Result: " + result);
            System.out.println("Pass: " + result.equals(expectedResults.get(i)));
            System.out.println();
        }
    }
}

