class Solution {
    /**
    You are given a list of integers.
    Write a function next_smallest() that returns the 2nd smallest element of the list.
    Return null if there is no such element.
    <p>
    next_smallest(Arrays.asList(1, 2, 3, 4, 5)) == Optional[2]
    next_smallest(Arrays.asList(5, 1, 4, 3, 2)) == Optional[2]
    next_smallest(Arrays.asList()) == Optional.empty
    next_smallest(Arrays.asList(1, 1)) == Optional.empty
     */
    public Optional<Integer> next_smallest(List<Integer> lst) {
        if (lst.isEmpty() || lst.size() < 2) {
            return Optional.empty();
        }

        Set<Integer> set = new HashSet<>(lst);
        if (set.size() < 2) {
            return Optional.empty();
        }

        List<Integer> sortedList = new ArrayList<>(set);
        Collections.sort(sortedList);
        return Optional.of(sortedList.get(1));
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test case 1:
        List<Integer> lst1 = Arrays.asList(1, 2, 3, 4, 5);
        System.out.println("Test case 1: " + solution.next_smallest(lst1)); // Expected output: Optional[2]

        // Test case 2:
        List<Integer> lst2 = Arrays.asList(5, 1, 4, 3, 2);
        System.out.println("Test case 2: " + solution.next_smallest(lst2)); // Expected output: Optional[2]

        // Test case 3:
        List<Integer> lst3 = Arrays.asList();
        System.out.println("Test case 3: " + solution.next_smallest(lst3)); // Expected output: Optional.empty

        // Test case 4:
