class Solution {
    /**
    Write a function that takes a message, and encodes in such a
    way that it swaps case of all letters, replaces all vowels in
    the message with the letter that appears 2 places ahead of that
    vowel in the english alphabet.
    Assume only letters.

    Examples:
    >>> encode("test")
    "TGST"
    >>> encode("This is a message")
    "tHKS KS C MGSSCGG"
     */
    public String encode(String message) {
        StringBuilder encodedMessage = new StringBuilder();
        for (char c : message.toCharArray()) {
            if (Character.isLetter(c)) {
                char lowerCaseChar = Character.toLowerCase(c);
                if ("aeiou".indexOf(lowerCaseChar) != -1) {
                    // Replace vowel with the letter 2 places ahead
                    int vowelIndex = "aeiou".indexOf(lowerCaseChar);
                    char newVowel = "aeiou".charAt((vowelIndex + 2) % 5);
                    encodedMessage.append(Character.isUpperCase(c) ? Character.toUpperCase(newVowel) : newVowel);
                } else {
                    // Swap case of consonant
                    encodedMessage.append(Character.isUpperCase(c) ? Character.toLowerCase(c) : Character.toUpperCase(c));
                }
            }
        }
        return encodedMessage.toString();
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.encode("test")); // "TGST"
        System.out.println(solution.encode("This is a message")); // "tHKS KS C MGSSCGG"
    }
}

