            Arrays.asList(0,81,12,3,1,21),
            Arrays.asList(0,8,1,2,1,7)
        );
        int[] expectedResults = {10, 25, 13, 11, 3, 7};

        for (int i = 0; i < testCases.size(); i++) {
            int result = solution.skjkasdkd(testCases.get(i));
            System.out.println("Test Case " + (i + 1) + ": " + result);
            if (result == expectedResults[i]) {
