        System.out.println("count_up_to(11) => " + solution.count_up_to(11)); // [2,3,5,7]
        System.out.println("count_up_to(0) => " + solution.count_up_to(0)); // []
        System.out.println("count_up_to(20) => " + solution.count_up_to(20)); // [2,3,5,7,11,13,17,19]
        System.out.println("count_up_to(1) => " + solution.count_up_to(1)); // []
        System.out.println("count_up_to(18) => " + solution.count_up_to(18)); // [2,3,5,7,11,13,17]
