class Solution {
    /**
     * Given a map, return True if all keys are strings and all keys are in lower case or  in upper case, else return False.
     * The function should return False is the given map is empty.
     */
    public boolean check_dict_case(Map<Object, Object> dict) {
        if (dict.isEmpty()) {
            return false;
        }

        boolean allLower = true;
        boolean allUpper = true;

        for (Object key : dict.keySet()) {
            if (!(key instanceof String)) {
                return false;
            }

            String strKey = (String) key;
            if (!strKey.equals(strKey.toLowerCase())) {
                allLower = false;
            }
            if (!strKey.equals(strKey.toUpperCase())) {
                allUpper = false;
            }
        }

        return allLower || allUpper;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test case 1: All keys are strings and in lower case
        Map<Object, Object> dict1 = new HashMap<>();
        dict1.put("a", "apple");
        dict1.put("b", "banana");
        System.out.println(solution.check_dict_case(dict1)); // Expected output: true

        // Test case 2: All keys are strings but not all in lower case or upper case
        Map<Object, Object> dict2 = new HashMap<>();
        dict2.put("a", "apple");
        dict2.put("A", "banana");
        dict2.put("B", "banana");
        System.out.println(solution.check_dict_case(dict2)); // Expected output: false

        // Test case 3: Not all keys are strings
        Map<Object, Object> dict3 = new HashMap<>();
        dict3.put("a", "apple");
        dict3.put(8, "banana");
        dict3.put("a", "apple");
        System.out.println(solution.check_dict_case(dict3)); // Expected output: false

        // Test case 4: All keys are strings but not all in lower case or upper case
        Map<Object, Object> dict4 = new HashMap<>();
        dict4.put("Name", "John");
        dict4.put("Age", "36");
        dict4.put("City", "Houston");
        System.out.println(solution.check_dict_case(dict4)); // Expected output: false

        // Test case 5: All keys are strings and in upper case
        Map<Object, Object> dict5 = new HashMap<>();
        dict5.put("STATE", "NC");
        dict5.put("ZIP", "12345");
        System.out.println(solution.check_dict_case(dict5)); // Expected output: true

        // Test case 6: Empty dictionary
        Map<Object, Object> dict6 = new HashMap<>();
        System.out.println(solution.check_dict_case(dict6)); // Expected output: false
    }
}

