class Solution {
    /**
    Given a list of positive integers x. return a sorted list of all
    elements that hasn't any even digit.

    Note: Returned list should be sorted in increasing order.

    For example:
    >>> unique_digits(Arrays.asList(15, 33, 1422, 1))
    [1, 15, 33]
    >>> unique_digits(Arrays.asList(152, 323, 1422, 10))
    []
     */
    public List<Integer> unique_digits(List<Integer> x) {
        List<Integer> result = new ArrayList<>();
        for (Integer num : x) {
            boolean hasEvenDigit = false;
            String strNum = String.valueOf(num);
            for (char c : strNum.toCharArray()) {
                int digit = Character.getNumericValue(c);
                if (digit % 2 == 0) {
                    hasEvenDigit = true;
                    break;
                }
            }
            if (!hasEvenDigit) {
                result.add(num);
            }
        }
        Collections.sort(result);
        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        List<Integer> test1 = Arrays.asList(15, 33, 1422, 1);
        List<Integer> test2 = Arrays.asList(152, 323, 1422, 10);
        List<Integer> test3 = Arrays.asList(1, 3, 5, 7, 9);
        List<Integer> test4 = Arrays.asList(2, 4, 6, 8, 10);

        System.out.println("Test 1: " + solution.unique_digits(test1)); // [1, 15, 33]
        System.out.println("Test 2: " + solution.unique_digits(test2)); // []
        System.out.println("Test 3: " + solution.unique_digits(test3)); // [1, 3, 5, 7, 9]
        System.out.println("Test 4: " + solution.unique_digits(test4)); // []
    }
