class Solution {
    /**
     * Returns a list of size n, where the value of the element at index i is the factorial of i if i is even
     * or the sum of numbers from 1 to i otherwise.
     * 
     * @param n the size of the list
     * @return a list of integers
     */
    public List<Integer> f(int n) {
        List<Integer> result = new ArrayList<>();
        for (int i = 1; i <= n; i++) {
            if (i % 2 == 0) {
                // calculate factorial
                int factorial = 1;
                for (int j = 1; j <= i; j++) {
                    factorial *= j;
                }
                result.add(factorial);
            } else {
                // calculate sum of numbers from 1 to i
                int sum = 0;
                for (int j = 1; j <= i; j++) {
                    sum += j;
                }
                result.add(sum);
            }
        }
        return result;
    }
}

public class Main {
    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.f(5)); // [1, 2, 6, 24, 15]
        System.out.println(solution.f(3)); // [1, 2, 6]
        System.out.println(solution.f(1)); // [1]
        System.out.println(solution.f(0)); // []
    }
}

