class Solution {
    /**
    Given an array of integers, sort the integers that are between 1 and 9 inclusive,
    reverse the resulting array, and then replace each digit by its corresponding name from
    "One", "Two", "Three", "Four", "Five", "Six", "Seven", "Eight", "Nine".

    For example:
      arr = [2, 1, 1, 4, 5, 8, 2, 3]
            -> sort arr -> [1, 1, 2, 2, 3, 4, 5, 8]
            -> reverse arr -> [8, 5, 4, 3, 2, 2, 1, 1]
      return ["Eight", "Five", "Four", "Three", "Two", "Two", "One", "One"]

      If the array is empty, return an empty array:
      arr = []
      return []

      If the array has any strange number ignore it:
      arr = [1, -1 , 55]
            -> sort arr -> [-1, 1, 55]
            -> reverse arr -> [55, 1, -1]
      return = ["One"]
     */
    public List<String> by_length(List<Integer> arr) {
        List<String> result = new ArrayList<>();
        String[] names = {"One", "Two", "Three", "Four", "Five", "Six", "Seven", "Eight", "Nine"};
        List<Integer> temp = new ArrayList<>();

        // Filter numbers between 1 and 9
        for (int num : arr) {
            if (num >= 1 && num <= 9) {
                temp.add(num);
            }
        }

        // Sort the list
        Collections.sort(temp);

        // Reverse the list
        Collections.reverse(temp);

        // Replace numbers with their corresponding names
        for (int num : temp) {
            result.add(names[num - 1]);
        }

        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test case 1: Normal array
        List<Integer> arr1 = Arrays.asList(2, 1, 1, 4, 5, 8, 2, 3);
        System.out.println("Test case 1: " + solution.by_length(arr1));

        // Test case 2: Empty array
        List<Integer> arr2 = new ArrayList<>();
        System.out.println("Test case 2: " + solution.by_length(arr2));

        // Test case 3: Array with strange numbers
        List<Integer> arr3 = Arrays.asList(1, -1, 55);
        System.out.println("Test case 3: " + solution.by_length(arr3));

        // Test case 4: Array with duplicates
        List<Integer> arr4 = Arrays.asList(2, 2, 2, 1, 1, 1, 3, 3, 3);
        System.out.println("Test case 4: " + solution.by_length(arr4));
    }
}

