class Solution {
    /**
    In this problem, you will implement a function that takes two lists of numbers,
    and determines whether it is possible to perform an exchange of elements
    between them to make lst1 a list of only even numbers.
    There is no limit on the number of exchanged elements between lst1 and lst2.
    If it is possible to exchange elements between the lst1 and lst2 to make
    all the elements of lst1 to be even, return "YES".
    Otherwise, return "NO".
    For example:
    exchange(Arrays.asList(1, 2, 3, 4), Arrays.asList(1, 2, 3, 4)) => "YES"
    exchange(Arrays.asList(1, 2, 3, 4), Arrays.asList(1, 5, 3, 4)) => "NO"
    It is assumed that the input lists will be non-empty.
     */
    public String exchange(List<Integer> lst1, List<Integer> lst2) {
        int oddCountInLst1 = 0;
        int evenCountInLst2 = 0;

        for (Integer num : lst1) {
            if (num % 2 != 0) {
                oddCountInLst1++;
            }
        }

        for (Integer num : lst2) {
            if (num % 2 == 0) {
                evenCountInLst2++;
            }
        }

        return oddCountInLst1 <= evenCountInLst2 ? "YES" : "NO";
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test case 1:
        List<Integer> lst1 = Arrays.asList(1, 2, 3, 4);
        List<Integer> lst2 = Arrays.asList(1, 2, 3, 4);
        System.out.println("Test case 1: " + solution.exchange(lst1, lst2)); // Expected output: "YES"

        // Test case 2:
        lst1 = Arrays.asList(1, 2, 3, 4);
        lst2 = Arrays.asList(1, 5, 3, 4);
        System.out.println("Test case 2: " + solution.exchange(lst1, lst2)); // Expected output: "NO"

        // Test case 3:
        lst1 = Arrays.asList(1, 3, 5, 7);
        lst2 = Arrays.asList(2, 4, 6, 8);
