class Solution {
    /**
    Task
    We are given two strings s and c, you have to deleted all the characters in s that are equal to any character in c
    then check if the result string is palindrome.
    A string is called palindrome if it reads the same backward as forward.
    You should return a tuple containing the result string and true/false for the check.
    Example
    For s = "abcde", c = "ae", the result should be ("bcd",false)
    For s = "abcdef", c = "b"  the result should be ("acdef",false)
    For s = "abcdedcba", c = "ab", the result should be ("cdedc",true)
     */
    public List<Object> reverse_delete(String s, String c) {
        StringBuilder sb = new StringBuilder();
        for (char ch : s.toCharArray()) {
            if (c.indexOf(ch) == -1) {
                sb.append(ch);
            }
        }
        String result = sb.toString();
        boolean isPalindrome = result.equals(sb.reverse().toString());
        return Arrays.asList(result, isPalindrome);
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.reverse_delete("abcde", "ae")); // ("bcd", false)
        System.out.println(solution.reverse_delete("abcdef", "b")); // ("acdef", false)
        System.out.println(solution.reverse_delete("abcdedcba", "ab")); // ("cdedc", true)
        System.out.println(solution.reverse_delete("radar", "r")); // ("ada", true)
        System.out.println(solution.reverse_delete("hello", "l")); // ("heo", false)
    }
}

