            for (char c : lst.get(i).toCharArray()) {
                if ((c - '0') % 2 != 0) {
                    count++;
                }
            }
            String temp = "the number of odd elements " + count + "n the str" + count + "ng " + count + " of the " + count + "nput.";
            result.add(temp);
        }
        return result;
    }

