class Solution {
    /**
    Given a string s and a natural number n, you have been tasked to implement
    a function that returns a list of all words from string s that contain exactly
    n consonants, in order these words appear in the string s.
    If the string s is empty then the function should return an empty list.
    Note: you may assume the input string contains only letters and spaces.
    Examples:
    select_words("Mary had a little lamb", 4) ==> ["little"]
    select_words("Mary had a little lamb", 3) ==> ["Mary", "lamb"]
    select_words("simple white space", 2) ==> []
    select_words("Hello world", 4) ==> ["world"]
    select_words("Uncle sam", 3) ==> ["Uncle"]
     */
    public List<String> select_words(String s, int n) {
        List<String> result = new ArrayList<>();
        String[] words = s.split("\\s+");
        for (String word : words) {
            int consonants = 0;
            for (char c : word.toLowerCase().toCharArray()) {
                if (c != 'a' && c != 'e' && c != 'i' && c != 'o' && c != 'u') {
                    consonants++;
                }
            }
            if (consonants == n) {
                result.add(word);
            }
        }
        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.select_words("Mary had a little lamb", 4)); // ["little"]
        System.out.println(solution.select_words("Mary had a little lamb", 3)); // ["Mary", "lamb"]
        System.out.println(solution.select_words("simple white space", 2)); // []
        System.out.println(solution.select_words("Hello world", 4)); // ["world"]
        System.out.println(solution.select_words("Uncle sam", 3)); // ["Uncle"]
        System.out.println(solution.select_words("", 3)); // []
        System.out.println(solution.select_words("a e i o u", 0)); // ["a", "e", "i", "o", "u"]
    }
}

