class Solution {
    /**
    You have to write a function which validates a given date string and
    returns true if the date is valid otherwise false.
    The date is valid if all of the following rules are satisfied:
    1. The date string is not empty.
    2. The number of days is not less than 1 or higher than 31 days for months 1,3,5,7,8,10,12. And the number of days is not less than 1 or higher than 30 days for months 4,6,9,11. And, the number of days is not less than 1 or higher than 29 for the month 2.
    3. The months should not be less than 1 or higher than 12.
    4. The date should be in the format: mm-dd-yyyy

    for example:
    valid_date("03-11-2000") => true
    valid_date("15-01-2012") => false
    valid_date("04-0-2040") => false
    valid_date("06-04-2020") => true
    valid_date("06/04/2020") => false
     */
    public boolean valid_date(String date) {
        if (date.isEmpty()) {
            return false;
        }

        String[] parts = date.split("-");
        if (parts.length != 3) {
            return false;
        }

        int month = Integer.parseInt(parts[0]);
        int day = Integer.parseInt(parts[1]);
        int year = Integer.parseInt(parts[2]);

        if (month < 1 || month > 12) {
            return false;
        }

        int maxDays = getMaxDays(month, year);
        if (day < 1 || day > maxDays) {
            return false;
        }

        return true;
    }

    private int getMaxDays(int month, int year) {
        if (month == 2) {
            if (isLeapYear(year)) {
                return 29;
            } else {
                return 28;
            }
        } else if (month == 4 || month == 6 || month == 9 || month == 11) {
            return 30;
        } else {
            return 31;
        }
    }

    private boolean isLeapYear(int year) {
        return (year % 4 == 0 && year % 100 != 0) || (year % 400 == 0);
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        System.out.println(solution.valid_date("03-11-2000")); // true
        System.out.println(solution.valid_date("15-01-2012")); // false
        System.out.println(solution.valid_date("04-0-2040")); // false
        System.out.println(solution.valid_date("06-04-2020")); // true
        System.out.println(solution.valid_date("06/04/2020")); // false
        System.out.println(solution.valid_date("02-29-2020")); // true
        System.out.println(solution.valid_date("02-29-2019")); // false
        System.out.println(solution.valid_date("13-01-2020")); // false
        System.out.println(solution.valid_date("01-32-2020")); // false
        System.out.println(solution.valid_date("")); // false
    }
}

