        System.out.println(Arrays.toString(result2)); // Expected output: [Hello, world!]

        // Test case 3: Count odd order lower-case letters
        int result3 = (int) solution.split_words("abcdef");
        System.out.println(result3); // Expected output: 3

        // Test case 4: Empty string
