class Solution {
    /**
    Given a positive integer n, return a sorted list that has the odd numbers in collatz sequence.

    The Collatz conjecture is a conjecture in mathematics that concerns a sequence defined
    as follows: start with any positive integer n. Then each term is obtained from the
    previous term as follows: if the previous term is even, the next term is one half of
    the previous term. If the previous term is odd, the next term is 3 times the previous
    term plus 1. The conjecture is that no matter what value of n, the sequence will always reach 1.

    Note:
        1. Collatz(1) is [1].
        2. returned list sorted in increasing order.

    For example:
    get_odd_collatz(5) returns [1, 5] # The collatz sequence for 5 is [5, 16, 8, 4, 2, 1], so the odd numbers are only 1, and 5.
     */
    public List<Integer> get_odd_collatz(int n) {
        List<Integer> result = new ArrayList<>();
        Set<Integer> seen = new HashSet<>();
        while (n != 1) {
            if (n % 2 == 1 && !seen.contains(n)) {
                result.add(n);
                seen.add(n);
            }
            n = n % 2 == 0 ? n / 2 : 3 * n + 1;
        }
        result.add(1);
        Collections.sort(result);
        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.get_odd_collatz(5)); // [1, 5]
        System.out.println(solution.get_odd_collatz(1)); // [1]
        System.out.println(solution.get_odd_collatz(10)); // [1]
        System.out.println(solution.get_odd_collatz(6)); // [1]
        System.out.println(solution.get_odd_collatz(27)); // [1, 5, 13, 27]
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.get_odd_collatz(14).equals(Arrays.asList(1, 5, 7, 11, 13, 17)),
                s.get_odd_collatz(5).equals(Arrays.asList(1, 5)),
                s.get_odd_collatz(12).equals(Arrays.asList(1, 3, 5)),
                s.get_odd_collatz(1).equals(List.of(1))
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

