class Solution {
    /**
    Given a list of numbers, return whether or not they are sorted
    in ascending order. If the a number appears more than twice, return false. Assume no negative numbers and only integers.

    Examples
    is_sorted(Arrays.asList(5)) -> true
    is_sorted(Arrays.asList(1, 2, 3, 4, 5)) -> true
    is_sorted(Arrays.asList(1, 3, 2, 4, 5)) -> false
    is_sorted(Arrays.asList(1, 2, 3, 4, 5, 6)) -> true
    is_sorted(Arrays.asList(1, 2, 3, 4, 5, 6, 7)) -> true
    is_sorted(Arrays.asList(1, 3, 2, 4, 5, 6, 7)) -> false
    is_sorted(Arrays.asList(1, 2, 2, 3, 3, 4)) -> true
    is_sorted(Arrays.asList(1, 2, 2, 2, 3, 4)) -> false
     */
    public boolean is_sorted(List<Integer> lst) {
        Map<Integer, Integer> countMap = new HashMap<>();
        for (Integer num : lst) {
            countMap.put(num, countMap.getOrDefault(num, 0) + 1);
            if (countMap.get(num) > 2) {
                return false;
            }
        }
        for (int i = 1; i < lst.size(); i++) {
            if (lst.get(i) < lst.get(i - 1)) {
                return false;
            }
        }
        return true;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.is_sorted(Arrays.asList(5))); // true
        System.out.println(solution.is_sorted(Arrays.asList(1, 2, 3, 4, 5))); // true
