class Solution {
    /**
    Create a function that takes a string as input which contains only square brackets.
    The function should return true if and only if there is a valid subsequence of brackets
    where at least one bracket in the subsequence is nested.

    is_nested("[[]]") -> true
    is_nested("[]]]]]]][[[[[]") -> false
    is_nested("[][]") -> false
    is_nested("[]") -> false
    is_nested("[[][]]") -> true
    is_nested("[[]][[") -> true
     */
    public boolean is_nested(String string) {
        int count = 0;
        for (char c : string.toCharArray()) {
            if (c == '[') {
                count++;
            } else if (c == ']') {
                count--;
                if (count > 0) {
                    return true;
                }
            }
        }
        return false;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.is_nested("[[]]") == true);  // true
        System.out.println(solution.is_nested("[]]]]]]][[[[[]") == false);  // false
        System.out.println(solution.is_nested("[][]") == false);  // false
        System.out.println(solution.is_nested("[]") == false);  // false
        System.out.println(solution.is_nested("[[][]]") == true);  // true
        System.out.println(solution.is_nested("[[]][[") == true);  // true
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.is_nested("[[]]" ),
                !s.is_nested("[]]]]]]][[[[[]" ),
                !s.is_nested("[][]" ),
                !s.is_nested("[]" ),
                s.is_nested("[[[[]]]]" ),
                !s.is_nested("[]]]]]]]]]]" ),
                s.is_nested("[][][[]]" ),
                !s.is_nested("[[]" ),
                !s.is_nested("[]]" ),
                s.is_nested("[[]][[" ),
                s.is_nested("[[][]]" ),
                !s.is_nested("" ),
                !s.is_nested("[[[[[[[[" ),
                !s.is_nested("]]]]]]]]" )
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

