class Solution {
    /**
     * Returns true if the last character of a given string is an alphabetical character and is not
     * a part of a word, and false otherwise.
     * 
     * @param txt the input string
     * @return true if the last character is an alphabetical character and is not a part of a word, false otherwise
     */
    public boolean check_if_last_char_is_a_letter(String txt) {
        // Remove trailing whitespace
        txt = txt.trim();

        // If the string is empty, return false
        if (txt.isEmpty()) {
            return false;
        }

        // Get the last character of the string
        char lastChar = txt.charAt(txt.length() - 1);

        // Check if the last character is an alphabetical character
        if (!Character.isLetter(lastChar)) {
            return false;
        }

        // Split the string into words
        String[] words = txt.split("\\s+");

        // If the last word is a single character, return true
        if (words[words.length - 1].length() == 1) {
            return true;
        }

        // If none of the above conditions are met, return false
        return false;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.check_if_last_char_is_a_letter("apple pie")); // false
        System.out.println(solution.check_if_last_char_is_a_letter("apple pi e")); // true
        System.out.println(solution.check_if_last_char_is_a_letter("apple pi e ")); // false
        System.out.println(solution.check_if_last_char_is_a_letter("")); // false
        System.out.println(solution.check_if_last_char_is_a_letter("a")); // true
        System.out.println(solution.check_if_last_char_is_a_letter("ab")); // false
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.check_if_last_char_is_a_letter("apple" ) == false,
                s.check_if_last_char_is_a_letter("apple pi e" ) == true,
                s.check_if_last_char_is_a_letter("eeeee" ) == false,
                s.check_if_last_char_is_a_letter("A" ) == true,
                s.check_if_last_char_is_a_letter("Pumpkin pie " ) == false,
                s.check_if_last_char_is_a_letter("Pumpkin pie 1" ) == false,
                s.check_if_last_char_is_a_letter("" ) == false,
                s.check_if_last_char_is_a_letter("eeeee e " ) == false,
                s.check_if_last_char_is_a_letter("apple pie" ) == false,
                s.check_if_last_char_is_a_letter("apple pi e " ) == false
        );
        if (correct.contains(false)) {
