class Solution {
    /**
    Create a function which returns the largest index of an element which
    is not greater than or equal to the element immediately preceding it. If
    no such element exists then return -1. The given array will not contain
    duplicate values.

    Examples:
    can_arrange(Arrays.asList(1,2,4,3,5)) = 3
    can_arrange(Arrays.asList(1,2,3)) = -1
     */
    public int can_arrange(List<Integer> arr) {
        int n = arr.size();
        int maxIndex = -1;
        for (int i = 1; i < n; i++) {
            if (arr.get(i) < arr.get(i - 1)) {
                maxIndex = i;
            }
        }
        return maxIndex;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        List<Integer> testCases = Arrays.asList(
            Arrays.asList(1,2,4,3,5),
            Arrays.asList(1,2,3),
            Arrays.asList(5,4,3,2,1),
            Arrays.asList(1,3,2,4,5),
            Arrays.asList(1)
        );
        int[] expectedResults = {3, -1, 0, 2, -1};

        for (int i = 0; i < testCases.size(); i++) {
            int result = solution.can_arrange(testCases.get(i));
            System.out.println("Test Case " + (i + 1) + ": " + testCases.get(i));
            System.out.println("Expected Result: " + expectedResults[i]);
            System.out.println("Actual Result: " + result);
            System.out.println("Pass: " + (result == expectedResults[i]));
            System.out.println();
        }
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.can_arrange(Arrays.asList(1, 2, 4, 3, 5)) == 3,
                s.can_arrange(Arrays.asList(1, 2, 4, 5)) == -1,
                s.can_arrange(Arrays.asList(1, 4, 2, 5, 6, 7, 8, 9, 10)) == 2,
                s.can_arrange(Arrays.asList(4, 8, 5, 7, 3)) == 4,
                s.can_arrange(List.of()) == -1
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

