class Solution {
    /**
    You are given a list of numbers.
    You need to return the sum of squared numbers in the given list,
    round each element in the list to the upper int(Ceiling) first.
    Examples:
    For lst = [1,2,3] the output should be 14
    For lst = [1,4,9] the output should be 98
    For lst = [1,3,5,7] the output should be 84
    For lst = [1.4,4.2,0] the output should be 29
    For lst = [-2.4,1,1] the output should be 6
     */
    public int sum_squares(List<Double> lst) {
        int sum = 0;
        for (Double num : lst) {
            sum += (int) Math.ceil(num) * (int) Math.ceil(num);
        }
        return sum;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        List<Double> testCases = Arrays.asList(
            Arrays.asList(1.0, 2.0, 3.0),
            Arrays.asList(1.0, 4.0, 9.0),
            Arrays.asList(1.0, 3.0, 5.0, 7.0),
            Arrays.asList(1.4, 4.2, 0.0),
            Arrays.asList(-2.4, 1.0, 1.0)
        );
        int[] expectedResults = {14, 98, 84, 29, 6};

        for (int i = 0; i < testCases.size(); i++) {
            int result = solution.sum_squares(testCases.get(i));
            System.out.println("Test Case " + (i + 1) + ": " + testCases.get(i));
            System.out.println("Expected Result: " + expectedResults[i]);
            System.out.println("Actual Result: " + result);
            System.out.println("Pass: " + (result == expectedResults[i]));
            System.out.println();
        }
    }
}

