                s.sum_squares(Arrays.asList(1.0, 2., 3.)) == 14,
                s.sum_squares(Arrays.asList(1., 3., 5., 7.)) == 84,
                s.sum_squares(Arrays.asList(1.4, 4.2, 0.)) == 29,
                s.sum_squares(Arrays.asList(-2.4, 1., 1.)) == 6,
                s.sum_squares(Arrays.asList(100., 1., 15., 2.)) == 10230,
