        System.out.println("Test Case 2:");
        System.out.println("Expected: Example_1");
        System.out.println("Actual: " + solution.fix_spaces("Example 1"));
        System.out.println();

        System.out.println("Test Case 3:");
        System.out.println("Expected: _Example_2");
        System.out.println("Actual: " + solution.fix_spaces(" Example 2"));
        System.out.println();

        System.out.println("Test Case 4:");
