class Solution {
    /**
    Create a function which takes a string representing a file's name, and returns
    "Yes" if the the file's name is valid, and returns "No" otherwise.
    A file's name is considered to be valid if and only if all the following conditions
    are met:
    - There should not be more than three digits ('0'-'9') in the file's name.
    - The file's name contains exactly one dot '.'
    - The substring before the dot should not be empty, and it starts with a letter from
    the latin alphapet ('a'-'z' and 'A'-'Z').
    - The substring after the dot should be one of these: ["txt", "exe", "dll"]
    Examples:
    file_name_check("example.txt") # => "Yes"
    file_name_check("1example.dll") # => "No" (the name should start with a latin alphapet letter)
     */
    public String file_name_check(String file_name) {
        // Count the number of digits in the file name
        int digitCount = 0;
        for (char c : file_name.toCharArray()) {
            if (Character.isDigit(c)) {
                digitCount++;
            }
        }

        // Check if the file name contains exactly one dot
        int dotCount = 0;
        for (char c : file_name.toCharArray()) {
            if (c == '.') {
                dotCount++;
            }
        }

        // Split the file name into two parts: before and after the dot
        String[] parts = file_name.split("\\.");

        // Check if the first part is not empty and starts with a letter
        boolean startsWithLetter = Character.isLetter(parts[0].charAt(0));

        // Check if the second part is one of the allowed extensions
        String[] allowedExtensions = {"txt", "exe", "dll"};
        boolean isValidExtension = false;
        for (String extension : allowedExtensions) {
            if (parts[1].equals(extension)) {
                isValidExtension = true;
                break;
            }
        }

        // Return "Yes" if all conditions are met, otherwise return "No"
        if (digitCount <= 3 && dotCount == 1 && startsWithLetter && isValidExtension) {
            return "Yes";
        } else {
            return "No";
        }
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test cases
        System.out.println(solution.file_name_check("example.txt")); // => "Yes"
        System.out.println(solution.file_name_check("1example.dll")); // => "No"
        System.out.println(solution.file_name_check("example.exe")); // => "Yes"
        System.out.println(solution.file_name_check("example.dll")); // => "Yes"
        System.out.println(solution.file_name_check("example.pdf")); // => "No"
        System.out.println(solution.file_name_check("123example.txt")); // => "No"
        System.out.println(solution.file_name_check("example")); // => "No"
        System.out.println(solution.file_name_check(".txt")); // => "No"
    }
}

