class Solution {
    /**
     * Sorts the given list of integers in ascending order according to the sum of their digits.
     * If there are several items with similar sum of their digits, orders them based on their index in original list.
     * If an integer is negative, then its first digit will be negative: e.g. -123 has digits -1, 2, and 3.
     *
     * @param nums the list of integers to be sorted
     * @return the sorted list of integers
     */
    public List<Integer> order_by_points(List<Integer> nums) {
        // Create a new list of pairs containing the original index and the sum of digits of each number
        List<Pair> pairs = new ArrayList<>();
        for (int i = 0; i < nums.size(); i++) {
            int sum = sumOfDigits(nums.get(i));
            pairs.add(new Pair(i, sum, nums.get(i)));
        }

        // Sort the list of pairs based on the sum of digits and original index
        Collections.sort(pairs, Comparator.comparingInt(p -> p.sum).thenComparingInt(p -> p.index));

        // Create a new list containing only the sorted numbers
        List<Integer> sortedNums = new ArrayList<>();
        for (Pair pair : pairs) {
            sortedNums.add(pair.num);
        }

        return sortedNums;
    }

    // Helper function to calculate the sum of digits of a number
    private int sumOfDigits(int num) {
        int sum = 0;
        while (num != 0) {
            sum += num % 10;
            num /= 10;
        }
        return sum;
    }

    // Helper class to store the original index, sum of digits, and the number itself
    private static class Pair {
        int index;
        int sum;
        int num;

        public Pair(int index, int sum, int num) {
            this.index = index;
            this.sum = sum;
            this.num = num;
        }
    }

