        System.out.println("Test 3: " + solution.double_the_difference(Arrays.asList(9, -2)) == 81);
        System.out.println("Test 4: " + solution.double_the_difference(Arrays.asList(0)) == 0);
        System.out.println("Test 5: " + solution.double_the_difference(new ArrayList<>()) == 0);
    }
}

