class Solution {
    /**
    There are eight planets in our solar system: the closerst to the Sun
    is Mercury, the next one is Venus, then Earth, Mars, Jupiter, Saturn,
    Uranus, Neptune.
    Write a function that takes two planet names as strings planet1 and planet2.
    The function should return a list containing all planets whose orbits are
    located between the orbit of planet1 and the orbit of planet2, sorted by
    the proximity to the sun.
    The function should return an empty list if planet1 or planet2
    are not correct planet names.
    Examples
    bf("Jupiter", "Neptune") ==> ["Saturn", "Uranus"]
    bf("Earth", "Mercury") ==> ["Venus"]
    bf("Mercury", "Uranus") ==> ["Venus", "Earth", "Mars", "Jupiter", "Saturn"]
     */
    public List<String> bf(String planet1, String planet2) {
        String[] planets = {"Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"};
        List<String> result = new ArrayList<>();

        int index1 = -1;
        int index2 = -1;

        for (int i = 0; i < planets.length; i++) {
            if (planets[i].equals(planet1)) {
                index1 = i;
            }
            if (planets[i].equals(planet2)) {
                index2 = i;
            }
        }

        if (index1 == -1 || index2 == -1) {
            return result;
        }

        int start = Math.min(index1, index2);
        int end = Math.max(index1, index2);

        for (int i = start + 1; i < end; i++) {
            result.add(planets[i]);
        }

        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        System.out.println(solution.bf("Jupiter", "Neptune")); // ["Saturn", "Uranus"]
        System.out.println(solution.bf("Earth", "Mercury")); // ["Venus"]
        System.out.println(solution.bf("Mercury", "Uranus")); // ["Venus", "Earth", "Mars", "Jupiter", "Saturn"]
        System.out.println(solution.bf("Invalid", "Neptune")); // []
        System.out.println(solution.bf("Jupiter", "Invalid")); // []
    }
}

