class Solution {
    /**
     * This function accepts a list of strings and returns the word with maximum number
     * of unique characters. If multiple strings have maximum number of unique
     * characters, it returns the one which comes first in lexicographical order.
     *
     * @param words A list of strings
     * @return The word with maximum number of unique characters
     */
    public String find_max(List<String> words) {
        String maxWord = "";
        int maxUniqueChars = 0;

        for (String word : words) {
            Set<Character> uniqueChars = new HashSet<>();
            for (char c : word.toCharArray()) {
                uniqueChars.add(c);
            }

            if (uniqueChars.size() > maxUniqueChars) {
                maxUniqueChars = uniqueChars.size();
                maxWord = word;
            } else if (uniqueChars.size() == maxUniqueChars) {
                if (word.compareTo(maxWord) < 0) {
                    maxWord = word;
                }
            }
        }

        return maxWord;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test case 1
        List<String> words1 = Arrays.asList("name", "of", "string");
        System.out.println("Expected: string, Actual: " + solution.find_max(words1));

        // Test case 2
        List<String> words2 = Arrays.asList("name", "enam", "game");
        System.out.println("Expected: enam, Actual: " + solution.find_max(words2));

        // Test case 3
        List<String> words3 = Arrays.asList("aaaaaaa", "bb", "cc");
        System.out.println("Expected: aaaaaaa, Actual: " + solution.find_max(words3));

        // Test case 4 (edge case: empty list)
        List<String> words4 = new ArrayList<>();
        System.out.println("Expected: , Actual: " + solution.find_max(words4));

        // Test case 5 (edge case: single element list)
        List<String> words5 = Arrays.asList("hello");
        System.out.println("Expected: hello, Actual: " + solution.find_max(words5));
    }
}

