class Solution {
    /**
    Given a string "text", return its md5 hash equivalent string with length being 32.
    If "text" is an empty string, return Optional.empty().

    >>> string_to_md5("Hello world") == "3e25960a79dbc69b674cd4ec67a72c62"
     */
    public Optional<String> string_to_md5(String text) throws NoSuchAlgorithmException {
        if (text.isEmpty()) {
            return Optional.empty();
        }

        MessageDigest md = MessageDigest.getInstance("MD5");
        byte[] hashBytes = md.digest(text.getBytes());
        BigInteger no = new BigInteger(1, hashBytes);
        String hashText = no.toString(16);
        while (hashText.length() < 32) {
            hashText = "0" + hashText;
        }
        return Optional.of(hashText);
    }

    public static void main(String[] args) throws NoSuchAlgorithmException {
        Solution solution = new Solution();

        // Test case 1: Non-empty string
        String text1 = "Hello world";
        String expected1 = "3e25960a79dbc69b674cd4ec67a72c62";
        Optional<String> result1 = solution.string_to_md5(text1);
        System.out.println("Test case 1: " + (result1.isPresent() && result1.get().equals(expected1) ? "Pass" : "Fail"));

        // Test case 2: Empty string
        String text2 = "";
        Optional<String> result2 = solution.string_to_md5(text2);
        System.out.println("Test case 2: " + (!result2.isPresent() ? "Pass" : "Fail"));

        // Test case 3: Another non-empty string
        String text3 = "Test string";
        String expected3 = "d41d8cd98f00b204e9800998ecf8427e";
        Optional<String> result3 = solution.string_to_md5(text3);
        System.out.println("Test case 3: " + (result3.isPresent() && result3.get().equals(expected3) ? "Pass" : "Fail"));
    }
}

