class Solution {
    /**
    Given two positive integers a and b, return the even digits between a
    and b, in ascending order. Please note that the even digits refer to even numbers less than 10.

    For example:
    generate_integers(2, 8) => [2, 4, 6, 8]
    generate_integers(8, 2) => [2, 4, 6, 8]
    generate_integers(10, 14) => []
     */
    public List<Integer> generate_integers(int a, int b) {
        List<Integer> result = new ArrayList<>();
        int start = Math.min(a, b);
        int end = Math.max(a, b);

        for (int i = start; i <= end; i++) {
            if (i % 2 == 0 && i < 10) {
                result.add(i);
            }
        }

        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();

        // Test case 1:
        System.out.println("Test case 1:");
        System.out.println("Input: a = 2, b = 8");
        System.out.println("Expected output: [2, 4, 6, 8]");
        System.out.println("Actual output: " + solution.generate_integers(2, 8));

        // Test case 2:
        System.out.println("\nTest case 2:");
        System.out.println("Input: a = 8, b = 2");
        System.out.println("Expected output: [2, 4, 6, 8]");
        System.out.println("Actual output: " + solution.generate_integers(8, 2));

        // Test case 3:
        System.out.println("\nTest case 3:");
        System.out.println("Input: a = 10, b = 14");
        System.out.println("Expected output: []");
        System.out.println("Actual output: " + solution.generate_integers(10, 14));
    }
}

public class Main {
    public static void main(String[] args) {
        Solution s = new Solution();
        List<Boolean> correct = Arrays.asList(
                s.generate_integers(2, 10).equals(Arrays.asList(2, 4, 6, 8)),
                s.generate_integers(10, 2).equals(Arrays.asList(2, 4, 6, 8)),
                s.generate_integers(132, 2).equals(Arrays.asList(2, 4, 6, 8)),
                s.generate_integers(17, 89).equals(List.of())
        );
        if (correct.contains(false)) {
            throw new AssertionError();
        }
    }
}

