class Solution {
    /**
    Given a positive integer n, you have to make a pile of n levels of stones.
    The first level has n stones.
    The number of stones in the next level is:
        - the next odd number if n is odd.
        - the next even number if n is even.
    Return the number of stones in each level in a list, where element at index
    i represents the number of stones in the level (i+1).

    Examples:
    >>> make_a_pile(3)
    [3, 5, 7]
     */
    public List<Integer> make_a_pile(int n) {
        List<Integer> result = new ArrayList<>();
        result.add(n);
        for (int i = 1; i < n; i++) {
            if (n % 2 == 0) {
                n += 2;
            } else {
                n += 2;
            }
            result.add(n);
        }
        return result;
    }

    public static void main(String[] args) {
        Solution solution = new Solution();
        System.out.println(solution.make_a_pile(3)); // [3, 5, 7]
        System.out.println(solution.make_a_pile(4)); // [4, 6, 8, 10]
        System.out.println(solution.make_a_pile(5)); // [5, 7, 9, 11, 13]
        System.out.println(solution.make_a_pile(1)); // [1]
    }
}

